import Typography from '@mui/material/Typography';

const ItemListContainer = ({greetings}) => 
    <Typography
        variant="h5"
        noWrap
        sx={{
        fontFamily: 'monospace',
        fontWeight: 700,
        letterSpacing: '.3rem',
        color: 'inherit',
        textDecoration: 'none',
        mt: '10%'
        }}
        align="center"
    >
        {greetings}
    </Typography>

export default ItemListContainer;
